        issues: 'https://api.github.com/repos/hyperledger/cacti/issues/1211',
        title: 'refactor(containers): migrate all images to ubuntu-22.04',
        body: "### Description\r\n\r\nInitially we were concerned about size and went with Alpine, but having a consistent shell experience for developer experience would probably be worth the hit we'd take in terms of image size. \r\nAlso reduces the attack vectors from the security standpoint since if all our images are based on the same OS it's less CVEs to deal with as they inevitably start rolling in.\r\n\r\n### Acceptance Criteria\r\n1. All container images that are currently on alpine are migrated\r\n2. If there are some that are exceptionally difficult to migrate then track those as follow-up issues and link to them from this issue description.\r\n3. Containers must still be working and this has to  be verified for each and every one of them either manually or by adding build automation to them (there's a separate PR already open for that)\r\n",
